# list

Object double linked list for nodejs.

## Getting Started

Install it in your browser:

```
npm install list
```

## API

### list.add(item,ref)

### list.add_head(item)

### list.add_tail(item)

### list.remove(item)

### list.next(item)

### list.prev(item)

### list.length

### list.head

### list.tail

### list.each(iterator)

### list.to_array()

### list.is_empty()


## Sample

```javascript
var list=require('list');
var mylist=new list();

mylist.add({name:'item1'});
mylist.add({name:'item2'});
mylist.add({name:'item3'});

mylist.each(function(item){
	console.log(item.name);
});
